describe('Stack read', function () {

    it('stack header read', function () {
        var h = new Buffer('010000006fe28c0ab6f1b372c1a6a246ae63f74f931e8365e15a089c68d6190000000000982051fd1e4ba744bbbe680e1fee14677ba1a3c3540bf7b1cdb606e857233e0e61bc6649ffff001d01e3629900', 'hex');

        var script = {
            'version': 'uint32',
            'prev_block': 'hash',
            'merkle_root': 'hash',
            'timestamp': 'uint32',
            'bits': 'uint32',
            'nonce': 'uint32',
        };

        var stack = new bitPony.stackReader(h, script)
        var r = stack.getResult();
        var r2 = bitPony.header.read(h);
        assert.equal(r.version, r2.version)
        assert.equal(r.prev_block, r2.prev_block)
        assert.equal(r.merkle_root, r2.merkle_root)
        assert.equal(r.timestamp, r2.timestamp)
        assert.equal(r.bits, r2.bits)
        assert.equal(r.nonce, r2.nonce)

    });

    it('stack block read', function () {
        //https://blockchain.info/ru/block/00000000839a8e6886ab5951d76f411475428afc90947ee320161bbf18eb6048?format=hex
        var h = new Buffer('', 'hex');

        /*EQUALS SCRIPTS*/
        var script = {
            'version': 'uint32',
            'prev_block': 'hash',
            'merkle_root': 'hash',
            'timestamp': 'uint32',
            'bits': 'uint32',
            'nonce': 'uint32',
            'txlist': 'vector.tx',
        };

        var script = {
            'header': 'header', //operator header read vector byte, so header->vector.tx is can not be executed
            'txfirst': 'tx',
        };

        var script = {
            'block': 'block'
        };
        /*EQUALS SCRIPTS*/

        //operator header read vector byte next after 80 byte header, so header->vector.tx is can not be executed
        //header user for net packages
        var script = {//WROONG!
            'header': 'header', //operator header read vector byte, so header->vector.tx is can not be executed
            'txlist': 'vector.tx',
        };

        //operator header80 dont read varint at 81 byte, so vector (varint + obj[]) can be read.
        var script = {//RIGHT!
            'header': 'header80',
            'txlist': 'vector.tx',
        };

        var stack = new bitPony.stackReader(h, script)
        assert.equal(stack.getResult().txlist.length, 1)

    });

    it('stack tx', function () {
        //https://blockchain.info/ru/tx/dfa14ed0d6446bcda697d94ccee6457e82ebefc1a3a9d4b5e9ac5a358122fe49?format=hex
        var h = new Buffer('', 'hex');

        /*EQUALS SCRIPTS*/
        var script = {
            'version': 'uint32',
            'in_count': 'var_int',
            'in_first': 'tx_in',
            'out_count': 'var_int',
            'out_first': 'tx_out',
            'out_second': 'tx_out',
            'lock_time': 'uint32',
        };
        var script = {
            'version': 'uint32',
            'in': 'vector.tx_in',
            'out': 'vector.tx_out',
            'lock_time': 'uint32',
        };
        /*EQUALS SCRIPTS*/

        var stack = new bitPony.stackReader(h, script)
        var res = stack.getResult();
        assert.equal(res.in.length, 1)
        assert.equal(res.out.length, 2)

    });

})



describe('reader', function () {

    it('stream', function () {

        var b = new Buffer('', 'hex');
        var stream = new bitPony.reader(b);

        var result = {};
        var res = stream.uint32(0);
        result.ver = (res.result);
        res = stream.vector_tx_in(res.offset);
        result.in = (res.result);
        res = stream.vector_tx_out(res.offset);
        result.out = (res.result);
        res = stream.uint32(res.offset);
        result.lock = (res.result);

        assert.equal(result.in.length, 1)
        assert.equal(result.out.length, 2)
        assert.equal(result.ver, 1)
        assert.equal(result.lock, 0)

    })

    it('read bytes str', function () {

        var b = new Buffer('', 'hex');
        var stream = new bitPony.reader(b);

        var result = [];

        //version
        var res = stream.uint32(0);
        result.push(res.result);

        //in cnt
        res = stream.var_int(res.offset);
        result.push(res.result)

        //in 1
        res = stream.hash(res.offset);
        result.push(res.result)
        res = stream.uint32(res.offset);
        result.push(res.result)
        res = stream.string(res.offset);
        result.push(res.result)
        res = stream.uint32(res.offset);
        result.push(res.result)

        //out count
        res = stream.var_int(res.offset);
        result.push(res.result)

        //out1
        res = stream.uint64(res.offset);
        result.push(res.result)
        res = stream.string(res.offset);
        result.push(res.result)

        //out2
        res = stream.uint64(res.offset);
        result.push(res.result)
        res = stream.string(res.offset);
        result.push(res.result)

        //lock time
        res = stream.uint32(res.offset);
        result.push(res.result)

        var tx = bitPony.tx.read(b);

        assert.equal(tx.version, result[0])
        assert.equal(tx.in.length, result[1])
        assert.equal(tx.in[0].hash, result[2])
        assert.equal(tx.in[0].index, result[3])
        assert.equal(tx.in[0].scriptSig, result[4].toString('hex'))
        assert.equal(0, result[5])//sequence
        assert.equal(tx.out.length, result[6])
        assert.equal(tx.out[0].amount, result[7])
        assert.equal(tx.out[0].scriptPubKey, result[8].toString('hex'))
        assert.equal(tx.out[1].amount, result[9])
        assert.equal(tx.out[1].scriptPubKey, result[10].toString('hex'))
        assert.equal(tx.lock_time, result[11])

    })

}) 